      .loadAclEntries(aclFeatureProto, stringTable);
  if (aclEntryList.size() > 0) {
    out.print("<acls>");
    for (AclEntry aclEntry : aclEntryList) {
      o("acl", aclEntry.toString());
    }
    out.print("</acls>");
  }
}
